        <h1>REACT CRUD APP</h1>
        <div className= "form_a">
          <label>Movie Name:</label>
          <input type="text" name="movieName" />
          <label>Review:</label>
          <input type="text" name="review" />

          <button>Submit</button>
        </div>
      </div>
    </body>
  );
}

export default App;
